@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

atm:BankCode a owl:Class .

atm:valid a owl:DatatypeProperty ;
  rdfs:domain atm:BankCode ;
  rdfs:range xsd:boolean .

atm:invalid a owl:DatatypeProperty ;
  rdfs:domain atm:BankCode ;
  rdfs:range xsd:boolean .

# A bank code is either valid or invalid, but not both
atm:BankCode rdfs:subClassOf [
  a owl:Restriction ;
  owl:onProperty atm:valid ;
  owl:hasValue true
] , [
  a owl:Restriction ;
  owl:onProperty atm:invalid ;
  owl:hasValue false
] , [
  a owl:Restriction ;
  owl:onProperty atm:valid ;
  owl:hasValue false
] , [
  a owl:Restriction ;
  owl:onProperty atm:invalid ;
  owl:hasValue true
] .
